import React, { useEffect, useState } from 'react';
import classes from './CatalogCardElem.module.css';
import { useNavigate, useParams } from 'react-router-dom';

export default function CatalogCardElem() {
    const navigate = useNavigate();
    const {id} = useParams();
    return (
        <div className={classes.catalog_card__container} onClick={() => navigate(`/${id}/one>`)}>
            <h4 className={classes.catalog_card__title}>{id}</h4>
            <img src = ""/>
        </div>
  );
}
